import React from 'react'
import jsonData from './data2.json'
import styled from 'styled-components';

function Players() {

  const getIMG = ({player}) => {

    /*let str = player.team.replaceAll(" ", "%20");*/

    return (
      <img src={require(`./logos/${str}.gif`)} alt={player.team}/>
    )
  }

  const displayData = jsonData.map((player) => {

    return(
      <tr>
        <td>{getIMG({player})}</td>
        <td>{player.position}</td>
        <td>{player.name}</td>
        <td>{player.points}</td>
      </tr>
    )
  }
  )

  return (
    <PlayerContainer>
      <div>
        <table className='center'>
          <thead>
            <tr>
              <th>Team</th>
              <th>Position</th>
              <th>Name</th>
              <th>Points</th>
            </tr>
          </thead>

          <tbody>
            {displayData}
          </tbody>
        </table>
      </div>
    </PlayerContainer>
  );
}

const PlayerContainer = styled.div`
  .center {
    margin-left: auto;
    margin-right: auto;
    width: 50%;
  }
  thead {
    background-color: lightgrey;
  }
  tbody tr:nth-child(even) {
    background-color: lightgrey;
  }
  table th {
    text-align: left;
    border: 1px solid;
  }
  table td {
    border: 1px solid;
  }
  table {
    border-collapse: collapse;
    margin: 20px;
  }
`;

export default Players;
